import React from "react";
import SkillCard from "./SkillCard"

function SkillList() {
  return (
    <>
      <section id="skills">
        <div className="container">
          <h2 className="section-title">Skills</h2>
          <div className="row skills-wrapper">
          <SkillCard />
          <SkillCard />
          <SkillCard />
          </div>
        </div>
      </section>

    </>
  );
}

export default SkillList;
